New-NoneBotPlugin() {
    #ç°åœ¨å¥½åƒæ²¡ç”¨äº†
    #ä»¥ååšç‰ˆæœ¬ç®¡ç†çš„æ—¶å€™è¦ç”¨
    local PluginName="$1"
    local WorkDir="${2:-$(pwd)}" # é»˜è®¤å½“å‰ç›®å½•

    local ProjectDir="${WorkDir}/${PluginName}"

    # åˆ›å»ºç›®å½•
    mkdir -p "${ProjectDir}/src/plugins" || {
        echo "é”™è¯¯ï¼šæ— æ³•åˆ›å»ºç›®å½•" >&2
        return 1
    }

    # ç”Ÿæˆ pyproject.toml
    cat >"${ProjectDir}/pyproject.toml" <<EOF
[project]
name = "${PluginName}"
version = "0.1.0"
description = "${PluginName}"
readme = "README.md"
requires-python = ">=3.9, <4.0"

[tool.nonebot]
adapters = [
    { name = "OneBot V11", module_name = "nonebot.adapters.onebot.v11" }
]
plugins = []
plugin_dirs = ["src/plugins"]
builtin_plugins = []
EOF

    # ç”Ÿæˆ .env æ–‡ä»¶
    cat >"${ProjectDir}/.env" <<'EOF'
ENVIRONMENT=dev
DRIVER=~fastapi+~websockets
EOF

    cat >"${ProjectDir}/.env.dev" <<'EOF'
LOG_LEVEL=DEBUG
EOF

    touch "${ProjectDir}/.env.prod"
    echo "[SUCCESS] æ’ä»¶ '${PluginName}' å·²åˆ›å»ºäº: ${ProjectDir}"
    echo "[NOTE] å®‰è£…ä¸srcç›®å½•ï¼Œä½¿ç”¨fastapi+websockets"
}

