    # MaxLine=${#ConfigLines[@]} # ç›´æ¥è·å–æ•°ç»„é•¿åº¦ä½œä¸ºæ€»è¡Œæ•°
    # EditingLineX=1 #åˆå§‹ä¸º1
    # set -x
    local __Screen #å°è¯•ä¼˜åŒ–
    local CurrentLineNumber="${1:-"1"}"
