    CursorRow=17 # æ²¡çˆ±äº†ï¼Œæ­»é¬¼tty
    __Screen+=" \033[${CursorRow};1H"
    ShowWidth="$(Get-StringDisplayWidth "${EditingLine:0:EditingLineX}")"
    CursorX="${ShowWidth}"

    # __Screen+="${BLUE}${TipContent}${NC}\n${EditingLine:0:EditingLineX}\n${EditingLineX}"
    __Screen+="${BLUE}${TipContent}${NC}"
    CursorRow=$((CursorRow + 5))
    __Screen+="\033[0J"                                   # æ¸…é™¤å…‰æ ‡åˆ°å±å¹•åº•éƒ¨çš„æ‰€æœ‰å†…å®¹
    __Screen+="\033[${CursorRow};1H"                      # å°†å…‰æ ‡ç§»åŠ¨åˆ°è¾“å‡ºå®Œçš„ä¸‹ä¸€è¡Œç¬¬1åˆ—
    EditingLine="${ProcessedConfigLines[OptionLine - 1]}" # ç›´æ¥æ•°ç»„è®¿é—®
    __Screen+="${GREEN}${EditingLine}${NC}"

    __Screen+="\033[${CursorRow};${CursorX}H" # å°†å…‰æ ‡ç§»åŠ¨åˆ°è¾“å‡ºå®Œçš„ä¸‹ä¸€è¡Œç¬¬xåˆ— ç”¨æˆ·è¾“å…¥/ä¿®æ”¹
    __Screen+="\033[?25h"                     # æ¢å¤å…‰æ ‡
    echo -ne "${__Screen}"
}

Get-StringDisplayWidth() {
    local str="$1"
    local width=0
    local char

    # ä½¿ç”¨whileå¾ªç¯é€ä¸ªå­—ç¬¦å¤„ç†
    while IFS='' read -r -n1 char; do
        wcwidth "${char}"
        ((width += $?))
    done <<<"${str}"

    echo "${width}"
}

wcwidth() {
    local char="$1"
    [[ -z "${char}" ]] && return 0 # ç©ºå­—ç¬¦å®½åº¦ä¸º0
    local code
    printf -v code '%d' "'${char}" # æ›´é«˜æ•ˆçš„è·å–å­—ç¬¦ç¼–ç æ–¹å¼

    # åˆ¤æ–­å…¨è§’å­—ç¬¦èŒƒå›´
    if ((code >= 0x4E00 && code <= 0x9FFF || \
        code >= 0x3400 && code <= 0x4DBF || \
        code >= 0x20000 && code <= 0x2A6DF || \
        code >= 0x3040 && code <= 0x309F || \
        code >= 0x30A0 && code <= 0x30FF || \
        code >= 0xAC00 && code <= 0xD7AF)); then
        return 2
    elif [[ "${char}" == $'\t' ]]; then # æ­£ç¡®åˆ¤æ–­åˆ¶è¡¨ç¬¦
        return 4
    else
        return 1
    fi
}

Load-Config() {
    # sleep 1
    # echo -e "\033[2J\033[H"
    # ä½¿ç”¨ mapfile é«˜æ•ˆè¯»å–æ–‡ä»¶å†…å®¹åˆ°æ•°ç»„ï¼ˆæ›¿ä»£ cat + å˜é‡ï¼‰
    ConfigLines=()
    mapfile -t ConfigLines <"${TARGETCONFIG}" # æ¯è¡Œå­˜å…¥æ•°ç»„å…ƒç´ 
    ProcessedConfigLines=()
    # åˆå§‹åŒ–å˜é‡
    LineNumber=0
    OptionsLines=()
    SelectedIndex=0
    CursorX=1
    MaxLine=${#ConfigLines[@]} # ç›´æ¥è·å–æ•°ç»„é•¿åº¦ä½œä¸ºæ€»è¡Œæ•°
    ShowConfigLines=()
    TipContent="æŒ‰æ–¹å‘é”®é€‰æ‹©ï¼ŒæŒ‰ié”®å¯ç”¨ç¼–è¾‘ï¼ŒESCé€€å‡º"
    IsEditing="false"
    EditingLineX=1
    # éå†å¤„ç†æ¯ä¸€è¡Œ
    for ((LineNumber = 0; LineNumber < MaxLine; LineNumber++)); do
        line_content="${ConfigLines[LineNumber]}"
        # åˆ¤æ–­å­—ç¬¦ä¸²æ˜¾ç¤ºå®½åº¦æ˜¯å¦é€‚é…å±å¹•ï¼Œå¦åˆ™æˆªæ–­å¤„ç†
        if ((__ScreenWidth >= $(Get-StringDisplayWidth "${line_content}"))); then
            ProcessedConfigLines[LineNumber]="${line_content}"
        else
            local width=0
            local pos=0
            local truncated=""

            # ä¼˜åŒ–ï¼šé¿å…å¤šæ¬¡è°ƒç”¨å¤–éƒ¨å‘½ä»¤
            while IFS= read -r -n1 char; do
                # è·å–å­—ç¬¦æ˜¾ç¤ºå®½åº¦ï¼ˆä¼˜åŒ–ä¸ºå†…ç½®å‡½æ•°ï¼‰
                wcwidth "${char}"
                # å®½åº¦æº¢å‡ºæ£€æŸ¥
                # printf "%s" "${char}"
                char_width=$?
                if ((width + char_width > __ScreenWidth)); then
                    break
                fi
                # æ›´æ–°çŠ¶æ€
                ((width += char_width))
                truncated+="${char}"
                ((pos++))
            done <<<"${line_content}"

            ProcessedConfigLines[LineNumber]="${truncated}"
        fi
        # ä»…æ£€æµ‹ç©ºè¡Œæˆ–æ³¨é‡Šè¡Œï¼ˆè·³è¿‡ä¸å¤„ç†ï¼‰
        if [[ "${line_content}" =~ ^[[:space:]]*($|#|\[|\]) ]]; then
            continue
        fi
        # è®°å½•æœ‰æ•ˆè¡Œå·ï¼ˆè¡Œå·ä»1å¼€å§‹ï¼‰
        OptionsLines+=("$((LineNumber + 1))")
    done
    CurrentLineNumber="${OptionsLines[${SelectedIndex}]}"
    # shellcheck disable=SC2034
    Columns="${#ConfigLines[@]}" # è·å–æ•°ç»„é•¿åº¦ä½œä¸ºæ€»åˆ—æ•°,ä¹Ÿå°±æ˜¯æ–‡ä»¶æœ€å¤§è¡Œ
    MaxIndex="${#OptionsLines[@]}"
    {
        Export-Variables "${ConfigLoaded}" ConfigLines ProcessedConfigLines \
            LineNumber OptionsLines SelectedIndex CursorX MaxLine \
            ShowConfigLines TipContent IsEditing CurrentLineNumber \
            Columns MaxIndex
    } >/dev/null # ä¸»ç¨‹åºå†…source "${ConfigLoaded}"
}

# é€šç”¨å˜é‡å¯¼å‡ºå‡½æ•°
# ç”¨æ³•ï¼šExport-Variables è¾“å‡ºæ–‡ä»¶å å˜é‡å1 å˜é‡å2 ...
Export-Variables() {
    local OutputFile="$1"
    shift # ç§»å‡ºæ–‡ä»¶åå‚æ•°ï¼Œå‰©ä½™å‚æ•°ä¸ºå˜é‡å

    true >"${OutputFile}" # æ¸…ç©ºç›®æ ‡æ–‡ä»¶

    for VarName in "$@"; do
        # æ£€æŸ¥å˜é‡æ˜¯å¦å­˜åœ¨
        if ! declare -p "${VarName}" &>/dev/null; then
            echo "è­¦å‘Š: å˜é‡ ${VarName} ä¸å­˜åœ¨ï¼Œå·²è·³è¿‡" >&2
            continue
        fi

        # è·å–å˜é‡å£°æ˜è¯­å¥å¹¶å†™å…¥æ–‡ä»¶
        {
            declare -p "${VarName}" | sed -E 's/^declare (-[a-zA-Z-]+) /declare -g \1 /'
            echo
        } >>"${OutputFile}"
    done

    echo "å˜é‡å·²å¯¼å‡ºåˆ° ${OutputFile} (å¯ç”¨ source åŠ è½½)"
}

