Invoke-UserInputPrompt() {
    local __prompt_message="$1"
    local __validation_pattern="${2:-}"
    local __default_value="${3:-}"
    local __is_sensitive_input="${4:-false}"
    local __auto_mode="${5:-${autoRecommended:-false}}"

    # è‡ªåŠ¨æ¨¡å¼å¤„ç†
    if [[ "${__auto_mode,,}" == "true" ]]; then
        echo "${__default_value}"
        return 0
    fi

    # äº¤äº’å¼è¾“å…¥å¤„ç†
    local __user_input
    local __read_opts="-r"

    # æ•æ„Ÿä¿¡æ¯å¤„ç†
    if [[ "${__is_sensitive_input,,}" == "true" ]]; then
        __read_opts="-s ${__read_opts}"
        # æ·»åŠ æ¢è¡Œç¬¦åˆ°æç¤ºä¿¡æ¯
        # __prompt_message="${__prompt_message}"
    else
        __prompt_message="${__prompt_message} (é»˜è®¤: ${__default_value}) "
    fi

    # æ‰§è¡Œè¯»å–æ“ä½œ
    IFS= read ${__read_opts:-''} -p "${__prompt_message}" __user_input

    # å¤„ç†æ•æ„Ÿè¾“å…¥æ¢è¡Œ
    # [[ "${__is_sensitive_input,,}" == "true" ]] && echo #ä¼ å€¼äº†å•Šï¼

    # åº”ç”¨è¾“å…¥é€»è¾‘
    __user_input="${__user_input:-${__default_value}}"

    # æ•°æ®æœ‰æ•ˆæ€§éªŒè¯
    if [[ -n "${__validation_pattern}" ]]; then
        if [[ "${__user_input}" =~ ${__validation_pattern} ]]; then
            echo "${__user_input}"
            return 0
        else
            echo "${__default_value}"
            return 1
        fi
    fi

    echo "${__user_input}"
}

Test-PythonDependencies() { # åºŸç‰©ä¸€ä¸ª
    local requirementsFile="${1:-requirements.txt}"
    local tmpFile=$(mktemp)

    if [[ ! -f "${requirementsFile}" ]]; then
        echo "âŒ é”™è¯¯: æœªæ‰¾åˆ° ${requirementsFile} æ–‡ä»¶" >&2
        return 1
    fi

    if ! command -v pip &>/dev/null; then
        echo "âŒ é”™è¯¯: æœªæ‰¾åˆ°pipå‘½ä»¤" >&2
        return 1
    fi

    echo "ğŸ” æ­£åœ¨æ£€æŸ¥Pythonä¾èµ–..."
    echo "ğŸ“¦ ä½¿ç”¨éœ€æ±‚æ–‡ä»¶: ${requirementsFile}"

    pip freeze >"${tmpFile}" || {
        echo "âŒ è·å–å·²å®‰è£…åŒ…åˆ—è¡¨å¤±è´¥" >&2
        rm -f "${tmpFile}"
        return 1
    }

    local missingCount=0
    local totalCount=0

    while read -r package; do
        # å¤„ç†æ³¨é‡Šå’Œç©ºæ ¼
        local package_line=$(echo "${package}" | sed -E 's/#.*$//' | xargs)
        [[ -z "${package_line}" ]] && continue

        ((totalCount++))

        # è·³è¿‡ç‰¹æ®Šä¾èµ–
        if [[ "${package_line}" == @* || "${package_line}" == -e* ]]; then
            echo "âš ï¸ [${totalCount}] è·³è¿‡ç‰¹æ®Šä¾èµ–: ${package_line}"
            continue
        fi

        # æå–åŒ…åå¹¶è½¬å°å†™
        local package_name=$(echo "${package_line}" | sed -E 's/[ =<>~!].*//')
        local package_name_lower=$(echo "${package_name}" | tr '[:upper:]' '[:lower:]')

        if grep -q "^${package_name_lower}==" "${tmpFile}"; then
            echo "âœ… [${totalCount}] å·²å®‰è£…: ${package_line}"
        else
            echo "âŒ [${totalCount}] æœªå®‰è£…: ${package_line}"
            ((missingCount++))
        fi
    done <"${requirementsFile}"

    rm -f "${tmpFile}"

    echo -e "\nğŸ“Š æ£€æŸ¥å®Œæˆ:"
    echo "æ€»æ£€æŸ¥åŒ…æ•°: ${totalCount}"
    echo "ç¼ºå¤±åŒ…æ•°: ${missingCount}"

    if [[ ${missingCount} -gt 0 ]]; then
        echo "ğŸ’¡ å»ºè®®æ‰§è¡Œ: pip install -r ${requirementsFile}"
        return 1
    else
        echo "ğŸ‰ æ‰€æœ‰ä¾èµ–å·²å®‰è£…!"
        return 0
    fi
}

