Download-Debian12RootFS() {
    # å›ºå®šè¾“å‡ºæ–‡ä»¶å
    FILENAME="LCX_Debian12.tar.xz"
    if Test-CacheAndRestore "${FILENAME}"; then
        return 0
    fi
    # ç¡¬ç¼–ç å‚æ•°ï¼ˆåªæ”¯æŒDebian12ï¼‰
    local DISTRO="debian"
    local RELEASE="bookworm"
    local ARCH="arm64"
    [[ $(uname -m) != 'aarch64' ]] && ARCH="amd64"
    local VARIANT="default"
    local BASE_URL="https://mirrors.tuna.tsinghua.edu.cn/lxc-images/images/${DISTRO}/${RELEASE}/${ARCH}/${VARIANT}/"

    echo "æ­£åœ¨è·å–æœ€æ–°Debian12é•œåƒ..."

    # è·å–æœ€æ–°ç›®å½•
    local LATEST_DIR=$(curl -fsSL "${BASE_URL}" |
        grep -oE 'href="[0-9]{8}_[0-9]{2}%3A[0-9]{2}/"' |
        sed 's/href="\(.*\)\/"/\1/; s/%3A/-/g' |
        sort -r | head -n1)

    [[ -z "${LATEST_DIR}" ]] && {
        echo "é”™è¯¯ï¼šæ— æ³•è·å–æœ€æ–°ç‰ˆæœ¬ç›®å½•ï¼"
        echo "éœ€è¦${FILENAME}ï¼ŒLXCrootfsæ–‡ä»¶ï¼Œä½ å¯ä»¥æ‰‹åŠ¨ä¸‹è½½å…¶ä»–ç±»ä¼¼æ–‡ä»¶("
        return 1
    }

    # æ„å»ºä¸‹è½½é“¾æ¥ï¼ˆæ³¨æ„URLä¸­éœ€è¦%3Aï¼‰
    local ROOTFS_URL="${BASE_URL}${LATEST_DIR//-/%3A}/rootfs.tar.xz"

    echo "â–¶ ç‰ˆæœ¬: ${LATEST_DIR//-/:}"
    echo "â–¶ æ¶æ„: ${ARCH}"
    echo "â–¶ ä¸‹è½½: ${ROOTFS_URL}"

    # å¼ºåˆ¶ä¸‹è½½åˆ°å›ºå®šæ–‡ä»¶å
    echo "å¼€å§‹ä¸‹è½½..."
    if wget --show-progress -q -O "${FILENAME}" "${ROOTFS_URL}"; then
        cp "./${FILENAME}" "./${FILENAME}.cache"
        echo "âˆš ä¸‹è½½å®Œæˆ â†’ ${FILENAME}"
    else
        echo "Ã— ä¸‹è½½å¤±è´¥ï¼è¯·æ£€æŸ¥ç½‘ç»œè¿æ¥"
        echo "LCX_Debian12.tar.xzçš„URLä¸ºï¼š${ROOTFS_URL}"
        echo "ä½ å¯ä»¥æ‰‹åŠ¨ä¸‹è½½æ”¾åˆ°å½“å‰è„šæœ¬ä½ç½®ï¼š${PWD0}ã€æˆ–$(pwd)"
        rm -f "${FILENAME}" 2>/dev/null # åˆ é™¤å¯èƒ½æ®‹ç•™çš„æ— æ•ˆæ–‡ä»¶
        return 1
    fi
}

Get-AllRepositorysTags() {
    if [ $# -eq 0 ]; then
        echo "Usage: $0 <git-repository-url>"
        return 1
    fi

    REPO_URL="$1"
    [[ "${REPO_URL}" =~ ^https?://(www\.)?github\.com ]] && REPO_URL="https://ghfast.top/${REPO_URL}"
    # è·å–æ ‡ç­¾åˆ—è¡¨ï¼ˆä»…å¼•ç”¨ï¼Œä¸åŒ…å«è§£å¼•ç”¨å¯¹è±¡ï¼‰
    # echo -e "${BLUE}å°è¯•è·å–tagsï¼ˆç‰ˆæœ¬ï¼‰....${NC}" åˆåŒå’å•å¿˜è®°æ˜¯è¾“å‡ºä¼ å€¼äº†
    tags=$(git ls-remote --tags --refs "$REPO_URL" 2>/dev/null)

    # æ£€æŸ¥å‘½ä»¤æ‰§è¡Œç»“æœ
    local _="$?"
    if [ "${_}" -ne 0 ]; then
        echo "Error: Failed to fetch tags from $REPO_URL" >&2
        return 1
    fi

    # å¤„ç†è¾“å‡ºå¹¶æ’åº
    echo "$tags" | awk '{print $2}' | sed 's/refs\/tags\///g' | sort -V

    # ä½¿ç”¨ç¤ºä¾‹: Get-AllRepositorysTags https://github.com/git/git.git
}

remove_easyinstall_windows() {
