                if ! mv -f "$extracted_dir"/* "$dir_name"/; then
                    echo -e "${RED}é”™è¯¯ï¼šæ–‡ä»¶ç§»åŠ¨å¤±è´¥${NC}"
                    rm -rf "$dir_name"
                    continue
                fi
            done
        }
    else
        echo "æœªçŸ¥é”™è¯¯"
