    # æ£€æµ‹ Linux å‘è¡Œç‰ˆä¿¡æ¯ï¼ˆä¸æƒ³è®¤è¯†çš„å°±ä¸è¦å‹‰å¼ºäº†å–µ~ï¼‰
    if [[ -f "/etc/os-release" ]]; then
