        echo -e "ç¯å¢ƒï¼š${os_name} ${os_version}"
        echo -e "ç³»ç»ŸID: ${os_id}"

        declare -A pkg_managers=(["apt"]="Debian/Ubuntuç³»" ["apt-get"]="Debian/Ubuntuç³»" ["dnf"]="Fedora/RHELç³»")

        for Cmd in "${!pkg_managers[@]}"; do
            if command -v "${Cmd}" >/dev/null 2>&1; then
                echo -e "åŒ…ç®¡ç†å™¨ï¼š${Cmd} (${pkg_managers[${Cmd}]})" # ä¿®å¤å˜é‡å¼•ç”¨
