        done

        echo -e "åŒ…ç®¡ç†å™¨ï¼šæœªçŸ¥ï¼ˆå…¶å®åªæ˜¯ä¸æƒ³è®¤è¯†ç½¢äº†ï¼‰"
        echo "å–µ~ éƒ½è¯´äº†ä¸æƒ³è®¤è¯†å•¦ (â•¯â€µâ–¡â€²)â•¯ï¸µâ”»â”â”»"
        envType="unknown"
