    else
        echo -e "ç¯å¢ƒï¼šæœªçŸ¥ Unix ç³»ç»Ÿï¼ˆéæ ‡å‡† Linux å‘è¡Œç‰ˆï¼‰"
        echo "ç¡®å®åªæ˜¯ä¸æƒ³è®¤è¯†ç½¢ (ç†ç›´æ°”å£®)"
