        echo -e "${GREEN}ä½ å¯ä»¥åœ¨è„šæœ¬æå‰ä¸‹è½½å¥½mongodbçš„äºŒè¿›åˆ¶åŒ…ï¼Œé‡å‘½åä¸ºâ€œmongodb.tgzâ€${NC}"

