                # å¯åŠ¨ä¸‹è½½è¿›ç¨‹
                { wget --show-progress -T 9999 -O "${output}" "${url}"; } &
                local wget_pid=$!
                # å¯åŠ¨ç›‘æ§è¿›ç¨‹
                {
                    printf "\ræ­£åœ¨ä¸‹è½½...Ctrl+C ä¸ä¼šé€€å‡ºè„šæœ¬"
                    while kill -0 "${wget_pid}" 2>/dev/null; do
                        sleep 1
                    done
                    return
                } &
                local monitor_pid=$!
                # è®¾ç½®ä¿¡å·å¤„ç†ï¼šç»ˆæ­¢ä¸‹è½½å’Œç›‘æ§è¿›ç¨‹ï¼Œå¹¶æ¢å¤åŸå§‹ trap
                trap 'kill -9 \"${wget_pid}\" \"${monitor_pid}\" 2>/dev/null; trap - SIGINT;stty isig' SIGINT
                # ç­‰å¾…ä¸‹è½½å®Œæˆ
