    }
    # å®‰è£…ä¾èµ–
    echo "æ­£åœ¨å®‰è£…åŸºç¡€ä¾èµ–..."
    Set-DownloadURL
    sudo apt-get install -y wget tar libcurl4 apt-utils curl
    Download-MongoDB || {
        log "å¤±è´¥ï¼šä½ çš„æœºå­å¥½åƒå’Œalistä¸ç†Ÿï¼Ÿ"
